// import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react'
import { getTests, getTest, createTests, updateTests, deleteTests } from './api';
//pages
import {HashRouter as Router, Routes, Route} from "react-router-dom"
import { home_page } from './pages/home_page';
import { sign_in } from './pages/sign_in';
import { view_profile } from './pages/view_profile';

function App() {

  const [data, setData] = useState()

    function updateUser() {
      let postObject = {
        name: "Katie Dinh",
        email: "ikatiedinh@gmail.com",
        text: "update",
        date: new Date()
      }

      updateTests("6739559ba1f13899db8cd84c", postObject)
    }
  /*useEffect(() => {
    async function loadAllTests() {
      let data = await getTests()
      if (data) {
        setData(data)
      }
    }

    loadAllTests()
  }, [])*/ //Empty dependency array means this only runs on first launch





  // return (
  //   <>
  //     <button onClick={updateUser}>Update User</button>
  //   </>
  // );
  //routes for each page
  return (
    <Router>
      <Routes>
        <Route path="/" element={<home_page/>}/>
        <Route path="/sign_in" element={<sign_in/>}/>
        <Route path="/view_profile" element={<view_profile/>}/>
      </Routes>
    </Router>
  )
}

export default App;
